%[text] ## **Analyzing Basal Bolus Start and End Times**
%[text] We observed that in many studies the first and last bolus and basal data points are far apart. This script investigates and aggregates statistics on that matter.
%[text] It uses the Babelbetes export (excluding PEDAP, T1DEXIP) December 4th, 2025 (3b5f1d6).
%[text] #### Author: Jan Wrede
%[text] #### Date created: 2025-12-04
rootFolder = "/Users/jan/git/nudgebg/babelbetes/data/out/2025-11-04";
queryTable = AIDIF.constructHiveQueryTable(rootFolder);
queryTable = sortrows(queryTable,["study_name","patient_id"]);
fprintf("There are %d rows",height(queryTable)); %[output:72c30d82]
queryTable.raw = cellfun(@parquetread,queryTable.path,UniformOutput=false) %[output:0f26b9ef]
%[text] ### 
%%
%[text] ### Investigate Start End Gaps
test = table([repmat("study1",5,1);repmat("study2",5,1)], [1,1,1,2,2,3,3,3,1,1]',["a","b","c", "a","b", "a","b","c", "b","c"]',VariableNames=["study","patient","dataType"]);
G = groupsummary(test,["study","patient"]);
G3 = G(G.GroupCount==3,:);
bKeep = all(ismember(test{:,["study","patient"]},G3{:,["study","patient"]},"rows"),2);
filted = test(bKeep,:);
gs = groupsummary(filted,["study","patient"]);
[g,c] = valueCounts(gs.GroupCount);
assert(g == 3);
assert(g == 3);
%%
function [grps,cnts] = valueCounts(a)
[grps,~,ic] = unique(a);
cnts = accumarray(ic,1);
end

%filter patietns with all 3 data types
G = groupsummary(queryTable,["study_name","patient_id"]);
G3 = G(G.GroupCount==3,:);
%note the importance of rows otherwise all G3 elements are used for comparison
bKeep = all(ismember(queryTable{:,["study_name","patient_id"]}, G3{:,["study_name","patient_id"]},"rows"),2);
queryTableFiltered = queryTable(bKeep,:);
tmp = groupsummary(queryTableFiltered,["study_name","patient_id"]);
[g,c] = valueCounts(tmp.GroupCount)  %[output:8a5995b6] %[output:19fe8ba6]
%%
function gap = startGap(dataType,raw)
    d = dictionary(dataType,raw);
    gap = min(d{"basal"}.datetime) - min(d{"bolus"}.datetime);
    gap = days(gap);
end

function gap = endGap(dataType,raw)
    d = dictionary(dataType,raw);
    gap = max(d{"basal"}.datetime) - max(d{"bolus"}.datetime);
    gap = days(gap);
end

function gap = overlap(dataType,raw)
    d = dictionary(dataType,raw);
    gap = min(max(d{"basal"}.datetime), max(d{"bolus"}.datetime)) - max(min(d{"basal"}.datetime), min(d{"bolus"}.datetime));
    gap = days(gap);
end

gaps = groupsummary(queryTableFiltered, ["study_name","patient_id"], {@startGap,@endGap,@overlap}, {"data_type", "raw"});
gaps = renamevars(gaps,["study_name","fun1_data_type_raw","fun2_data_type_raw","fun3_data_type_raw"],["study","startGap","endGap","overlap"]) %[output:94e10c9e]
%%
%[text] ### CDF
vars = {'startGap','endGap','overlap'};
xlabels = {...
    'Gap Time (days) basal-bolus (negative → basal started earlier)', ...
    'Gap Time (days) basal-bolus (negative → basal started earlier)', ...
    'Overlap Time (days) (negative → no overlap)'};
titles = {...
    'Start Gap', ...
    'End Gap', ...
    'Overlap'};

[G, studyNames] = findgroups(gaps.study);

for i = 1:numel(vars) %[output:group:554b29a9]
    fig = figure('Units','centimeters','Position',[0 0 12 5]); hold on; %[output:4e1f82ac] %[output:0122c487] %[output:90fd2038]
    
    % Use splitapply with cdfplot
    splitapply(@(x) cdfplot(x), gaps.(vars{i}), G);
    
    xlabel(xlabels{i});
    ylabel('CDF');
    title(titles{i});
    legend(studyNames,'Location','best');
    hold off;
    
    % Save as PDF
    saveas(fig, sprintf('%s.pdf', vars{i}));
end %[output:group:554b29a9]
%%
%[text] ### Summary Statistics
R = groupsummary(gaps,"study",{"min",@(x) prctile(x,5),"median", @(x) prctile(x,95),"max"} ,["startGap","overlap","endGap"]);
function newName = renameVar(varname)
    newName =  varname;
    if contains(varname,"_")
        parts = split(varname,"_");
        newName = char(parts(2)) + "_" + string(parts(1));
    end
end
newNames = cellfun(@renameVar,R.Properties.VariableNames,UniformOutput=false);
R.Properties.VariableNames = [newNames{:}];
R.Properties.VariableNames = strrep(R.Properties.VariableNames,"fun1","p5");
R.Properties.VariableNames = strrep(R.Properties.VariableNames,"fun2","p95");
R = rows2vars(R,'VariableNamesSource','study');
R.Properties.RowNames = R.OriginalVariableNames;  % original variable names
R(:,'OriginalVariableNames') = [];
R %[output:082f4f6f]
writetable(R,'basalBolusDatetimeStats.csv','WriteRowNames',true)
